import React from "react";

const HeroSection = () => {
  return (
    <section className="relative h-screen bg-cover bg-center flex items-center justify-center text-white"
      style={{ backgroundImage: "url('/assets/hero-bg.jpg')" }}>
      <div className="absolute inset-0 bg-black bg-opacity-50"></div>
      <div className="relative text-center px-6">
        <h1 className="text-5xl font-extrabold">"Your Health, Our Priority"</h1>
        <p className="text-xl mt-4 max-w-2xl mx-auto">
          Book doctor appointments, consult online, and access prescriptions easily.
        </p>
      </div>
    </section>
  );
};

export default HeroSection;
